import React from "react";
import './Footer.css';

function Footer() {
    return(
        <footer>
            <input placeholder="Unesite ime"></input>
            <input placeholder="Unesite broj"></input>
            <button>Sacuvaj</button>
        </footer>
    );
}

export default Footer;
